INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 0.0, 24015, 24, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 10021, 4, 0.0, "2030/12/17 14:59:59", 4, 110501, "カオリ（サマー）", "2019/07/31 12:00:00", 1);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (4.0, 0.0, 24016, 24, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 10021, 1, 0.0, "2030/12/17 14:59:59", 4, 110501, "カオリ（サマー）", "2019/07/31 12:00:00", 2);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 0.0, 24017, 24, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 10021, 4, 0.0, "2030/12/17 14:59:59", 4, 110501, "カオリ（サマー）", "2019/07/31 12:00:00", 3);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (5.2, 0.0, 24018, 24, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 10021, 2, 0.0, "2030/12/17 14:59:59", 1, 110501, "カオリ（サマー）", "2019/07/31 12:00:00", 4);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (4.2, 0.0, 24019, 24, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 10021, 6, 0.0, "2030/12/17 14:59:59", 5, 110501, "カオリ（サマー）", "2019/07/31 12:00:00", 5);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 0.0, 24020, 24, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 10021, 2, 0.0, "2030/12/17 14:59:59", 2, 110501, "カオリ（サマー）", "2019/07/31 12:00:00", 6);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (6.4, 0.0, 24021, 24, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 10021, 6, 0.0, "2030/12/17 14:59:59", 1, 110501, "カオリ（サマー）", "2019/07/31 12:00:00", 7);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 0.0, 24022, 24, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 10021, 2, 0.0, "2030/12/17 14:59:59", 2, 110501, "カオリ（サマー）", "2019/07/31 12:00:00", 8);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (10.08, 0.0, 24023, 24, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 10021, 3, 0.0, "2030/12/17 14:59:59", 6, 110501, "カオリ（サマー）", "2019/07/31 12:00:00", 9);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (5.0, 0.0, 24024, 24, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10021, 2, 0.0, "2030/12/17 14:59:59", 1, 110501, "カオリ（サマー）", "2019/07/31 12:00:00", 10);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 0.0, 24025, 24, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 10021, 2, 0.0, "2030/12/17 14:59:59", 2, 110501, "カオリ（サマー）", "2019/07/31 12:00:00", 11);
